import classes from "./Navigation.module.scss";

const Navigation = () => {
  return (
    <nav className={classes.nav}>
      <ul className={classes["nav__items"]}>
        <li className={classes["nav__item"]}>
          <a className={classes["nav__item--link"]}>Home</a>
        </li>
        <li className={classes["nav__item"]}>
          <a className={classes["nav__item--link"]}>Features</a>
        </li>
        <li className={classes["nav__item"]}>
          <a className={classes["nav__item--link"]}>FAQ</a>
        </li>
        <li className={classes["nav__item"]}>
          <a className={classes["nav__item--link"]}>Login</a>
        </li>
      </ul>
    </nav>
  );
};

export default Navigation;
